import React, { Component } from 'react';
import MuiThemeProvider from 'material-ui/styles/MuiThemeProvider'
import LoanForm from './components/loan-form';
import './App.css';

class App extends Component {

  constructor() {
    super();
    this.state = {};
  } 

  render() {
    return (
      <MuiThemeProvider>
        <div className="App">
          <LoanForm />
        </div>
      </MuiThemeProvider>
    );
  }
}

export default App;
